function formCabecera(doc){
    var imgData = 'data:image/jpeg;base64,';
    doc.addImage(imgData, 'JPEG', 10, 20, 190, 10);
}

function formPiePagina(doc, numero){
    doc.setLineWidth(0.5);
    doc.line(10, 290, 190, 290);
    doc.setFontSize(10)
    doc.text(200, 290, numero)
}



