function formPDF(info){
    console.log('ol');
    numPages = 0;
    var doc = new jsPDF();
    pageHeight= doc.internal.pageSize.height;
    formPDFfirstPage(doc);
    y=pageHeight;
    //para el indice
    doc.addPage();
    formCabecera(doc);
    pageIndex = 2;
    z=50;
    
    if(info.length == 0){
        doc.setFontSize(20);
        doc.setFontType('bold');
        doc.text(15, z, 'NO HAY OBRAS EXHIBIDAS EN ESTE MUSEO.');
        z+=10;
    }else{
        doc.setFontSize(20);
        doc.setFontType('bold');
        doc.text(15, z, 'INDICE');
        z+=10;
    }
    for (var i=0; i<info.length;i++){
        salaN = "Sala "+(i+1);
        if(!validar(y+30, doc, numPages, pageHeight)){
            numPages+=1;
            y=40;
        }
        doc.setPage(pageIndex);
        if(z>pageHeight){
            doc.addPage();
            formCabecera(doc);
            z=40;
            pageIndex +=1;
        }
        doc.setFont('helvetica');
        doc.setFontSize(10);
        doc.setFontType('normal');
        doc.text(25, z, salaN);
        for (var j=40;j<175;j++){
            doc.text(j, z, '.');
        }
        doc.text(180, z, numPages+'');
        z+=10;
        doc.setPage(pageIndex+numPages);
        doc.setFontSize(20);
        doc.setFontType('bold');
        doc.setFont('courier');
        y+=10;
        doc.text(15, y, salaN);
        doc.setFontSize(15);
        doc.setFontType('normal');
        y+=10;
        doc.text(15, y, "Tema Curatorial: "+info[i].temaCuratorial);
        y+=10;
        doc.text(15, y, "Obras: ");
        obras = info[i].obras;
        for(var j=0;j<obras.length;j++){
            r = ficha(obras[j], doc, y, numPages, pageHeight);
            numPages = r[1];
            y = r[0];
        }
        formPiePagina(doc,numPages+'');
        
    }
    doc.save('catalogoMuseo.pdf');
}




function imgToBase64(){
    var img = new Image();
    img.crossOrigin = 'Anonymous';
    
    // The magic begins after the image is successfully loaded
    img.onload = function () {
        var canvas = document.createElement('canvas'),
        ctx = canvas.getContext('2d');

        canvas.height = img.naturalHeight;
        canvas.width = img.naturalWidth;
        ctx.drawImage(img, 0, 0);
        resultado = canvas.toDataURL('image/jpeg');
        console.log(resultado);
    };
    var url = 'http://localhost:3000/static_assets/BaseObj.obj';
    img.src = url;
}

function transformation(){
    let ajaxRequest = new XMLHttpRequest();
    ajaxRequest.open("GET", "http://localhost:3000/museo/api/catalogo", false);
    ajaxRequest.onreadystatechange = function() {
        if (ajaxRequest.readyState == 4 && ajaxRequest.status == 200) {
            info = JSON.parse(ajaxRequest.responseText);
            var numSalasObras = 0;
            for (var i = 0; i <info.length; i++){
                obras = info[i].obras;
                if(obras.length > 0){
                    numSalasObras+=1;
                }
                for (var j = 0; j<obras.length;j++){
                    obra = obras[j];
                    if (obra.imagenes != 'null'){
                        img = obra.imagenes.split(';');
                        longImg = img.length;
                        if(longImg == 1){
                                cantidadT+=1;
                                toBase64(img[0]);
                        }else{
                            for (var k=0;k<longImg;k++){
                                cantidadT+=1;
                                toBase64(img[k]);
                            }
                        }
                    }
                }
            }
            if(numSalasObras == 0){
                formPDF(info);
            }
            
        }
    }
    ajaxRequest.send(null);
}

function toBase64(name){
    var img = new Image();
    img.crossOrigin = 'Anonymous';
    //dataSave = [indexSala, indexObra];
    //img64.push(dataSave);
    // The magic begins after the image is successfully loaded
    img.onload = function () {
        var canvas = document.createElement('canvas'),
        ctx = canvas.getContext('2d');

        canvas.height = img.naturalHeight;
        canvas.width = img.naturalWidth;
        ctx.drawImage(img, 0, 0);
        var uri = canvas.toDataURL('image/jpeg');
        console.log(img64);
        //nextInfo = img64[0];
        //img64.shift();
        //console.log(nextInfo);
        //indexSala = nextInfo[0];
        //indexObra = nextInfo[1];
        //console.log(indexSala, indexObra, img.src);
        name = img.src.split('/')[4].replace('%20',' ');
        console.log(name);
        if(img64[name] === undefined){
            img64[name] = uri;
        }
        cantidadT-=1;
        if(cantidadT == 0){
            console.log('end');
            console.log(img64);
            formPDF(info);
        }
    };
    var url = 'http://localhost:3000/static_assets/'+name;
    img.src = url;
}

